import ReactDOM from 'react-dom/client';
import {BrowserRouter, Route, Switch } from 'react-router-dom'
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <React.StrictMode>
    <BrowserRouter>
      <Switch>
        <Route exact path = "/lightnovel/:lightNovel.id" component = {LNPage} />
        <App />
      </Switch>
    </BrowserRouter>
  </React.StrictMode>
);
